const levels={info:1,warn:2,error:3,none:4};let level=levels.info;function setLevel(e){level=levels[e]}function log(...e){level>levels.info||console.log(...e)}function warn(...e){level>levels.warn||console.warn(...e)}function error(...e){level>levels.error||console.error(...e)}export{setLevel,log,warn,error};